						["custom"] = "function(event, trigger, states)\n    if states and states[\"\"] then\n        local state = states[\"\"]\n        \n        if state.duration and state.duration > 0 then\n            local r = aura_env.region\n            local b = r.bar\n            \n            -- currentGCD\n            local gcdStart, gcdDur = GetSpellCooldown(61304)\n            \n            if gcdStart > 0 then\n                local remainingGCD = (gcdStart + gcdDur) - GetTime()\n                \n                if remainingGCD > 0 then\n                    local width = min(b.fg:GetWidth(), (r:GetWidth() / state.duration) * remainingGCD)\n                    \n                    b.currentGCD:SetHeight(b.fg:GetHeight())\n                    b.currentGCD:SetPoint(\"LEFT\", b.fg, \"LEFT\", b.fg:GetWidth() - width, 0)\n                    b.currentGCD:SetAlpha(1)\n                    \n                    C_Timer.After(remainingGCD, function() b.currentGCD:SetAlpha(0) end)\n                end\n            else\n                b.currentGCD:SetAlpha(0)\n            end\n            \n            --Calculate the Global Cooldown\n            if not aura_env.gcd then\n                aura_env.gcd = gcdDur > 0 and gcdDur or (1.5 / (1 + (0.01 * UnitSpellHaste(\"player\"))))\n                \n            elseif gcdDur > 0 and gcdDur ~= aura_env.gcd then\n                aura_env.gcd = gcdDur\n            end\n        end\n    end\nend",
